INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1001, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1.4, 0, 0, "春咲 ひより", 1, 0, 0, 1, 0, 1, "お！\nあそこに困ってそうな人発見！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "みんなみたいに\nわたしも強くならなきゃ", 1002, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1.4, 0, 0, "草野 優衣", 1, 0, 0, 1, 0, 1, "大切な人を\n守れるようになりたい…って");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "フェンシングを始めてみては？", 1003, "少しは磨かれると思いますよ。", 1.4, 0, 0, "士条 怜", 1, 0, 0, 1, 0, 1, "キミに必要な集中力と感性が");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "ねぇ、にいちゃん！", 1004, "みそぎはねぇ、\nかくれんぼやりたい！", 1.5, 0, 0, "穂高 みそぎ", 1, 0, 0, 1, 0, 1, "今日はなにして遊ぶ？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "風宮あかりです", 1006, "私といっしょに…\nいかない？", 1.4, 0, 0, "風宮 あかり", 1, 0, 0, 1, 0, 1, "ねぇ…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "出雲宮子なのー", 1007, "食べ物の恨みは怖いのー", 1.5, 0, 0, "出雲 宮子", 1, 0, 0, 1, 0, 1, "プリンたべたいのー");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "ボクは虹村雪。", 1008, "いいよ。\n見られることは運命さ…", 1.4, 0, 0, "虹村 雪", 1, 0, 0, 1, 0, 1, "キミもボクの美貌に\n吸い寄せられたんだね。");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "フッ…聞いて後悔するがいい！", 1009, "人呼んで「疾風の冥姫」!!", 1.4, 0, 0, "柊杏奈", 1, 0, 0, 1, 0, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "マホマホ王国のプリンセス、\nまほ姫どす", 1010, "ほんまおおきにやわ～♪", 1.5, 0, 0, "姫宮 真歩", 1, 0, 0, 1, 0, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "衣之咲璃乃です！", 1011, "ここで会ったが\n100年目～！", 1.4, 0, 0, "衣之咲 璃乃", 1, 0, 0, 1, 0, 1, "生き別れたお兄ちゃんを探して\n三千世界！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1012, "…って、お願い！\n誰にも言わないでおいて～！", 1.4, 0, 0, "柏崎 初音", 1, 0, 0, 1, 0, 1, "ち、超能力って…\n何のことかな～？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "ちょす！\n美波鈴奈だよ～♪", 1016, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1.4, 0, 0, "美波 鈴奈", 1, 0, 0, 1, 0, 1, "一応カリスマ読モJKやってまっす！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "はいたーい。\n喜屋武香織さー。", 1017, "でも、沖縄もとってもいいとこさー", 1.4, 0, 0, "喜屋武 香織", 1, 0, 0, 1, 0, 1, "東京は遊園地みたいなところさー");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "支倉伊緒です。", 1018, "イオちゃんって呼んでね。", 1.4, 0, 0, "支倉 伊緒", 1, 0, 0, 1, 0, 1, "先生って呼ばれるのは\nくすぐったいから");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1020, "ミミをおいてかないでぇ～", 1.5, 0, 0, "茜 ミミ", 1, 0, 0, 1, 0, 1, "あ！/\お兄ちゃ～ん\nまってよ～");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "あ…あの…えっと…\n栗…林…くるみ…です……", 1021, "ふぇぇぇぇぇん……", 1.5, 0, 0, "栗林 くるみ", 1, 0, 0, 1, 0, 1, "あの……\nふぇ……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "風宮よりです。\nあああああ！", 1022, "なんてありがとうございます！", 1.4, 0, 0, "風宮 より", 1, 0, 0, 1, 0, 1, "こんな私に貴重な時間を\n割いていただき、");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1023, "私こっち行きたいー\nね、早く早くー", 1.5, 0, 0, "北条 綾音", 1, 0, 0, 1, 0, 1, "おにいちゃんどこいくの？\nえ？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "わっ…わっ…私、\n天野すずめといいます！", 1025, "これて何か違う…\nあああすみません！", 1.4, 0, 0, "天野 すずめ", 1, 0, 0, 1, 0, 1, "ふ、不束者ですが\nどうぞ末永く…って、");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "……クスクス…私は\n…倉石恵理子……", 1027, "離しませんわ………\n絶対に…!!", 1.4, 0, 0, "倉石 恵理子", 1, 0, 0, 1, 0, 1, "あなたは…運命の……\n伴侶……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1028, "…そうでしょ？？", 1.4, 0, 0, "佐々木 咲恋", 1, 0, 0, 1, 0, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "桜井望だよ！\nよろしくねっ", 1029, "あはは、\n私もまだまだだなぁ～", 1.4, 0, 0, "桜井 望", 1, 0, 0, 1, 0, 1, "ぇっと…\nキミ、私のこと知らないの?!");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "デケデケデンっ！", 1030, "ショーグン、\nワタシと一緒に天下統一デース！", 1.4, 0, 0, "ニノン・ジュベール", 1, 0, 0, 1, 0, 1, "初めまして、\n私はニノン・ジュベール申すデス！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "上喜しのぶです。\n手元のドクロが父です。", 1031, "おかしいですね……", 1.4, 0, 0, "上喜 しのぶ", 1, 0, 0, 1, 0, 1, "でもって私の隣にいるのが……\nえ、見えない？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "目指すはビッグな\nお笑い芸人だっぺ！", 1033, "そう、\nオラのボケに突っ込める相方が…！", 1.5, 0, 0, "野戸まひる", 1, 0, 0, 1, 0, 1, "けんども\nそれには足りないモンが…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1034, "ちょ\nちょっと一杯飲んできます…！", 1.4, 0, 0, "綾瀬 ゆかり", 1, 0, 0, 1, 0, 1, "ちょっと緊張しちゃって…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "氷川鏡華…です", 1036, "これ以上お話しすることは…\nないです！", 1.5, 0, 0, "氷川 鏡華", 1, 0, 0, 1, 0, 1, "知らない人とは話しちゃいけないので");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "柏崎…栞です。", 1038, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1.4, 0, 0, "柏崎 栞", 1, 0, 0, 1, 0, 1, "……あ、アラーム。");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "ふ、双葉碧です。", 1040, "野に咲く花が、\n唯一の話相手です。", 1.4, 0, 0, "双葉 碧", 1, 0, 0, 1, 0, 1, "私、一人も友達がいなくて……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "三角千歌です。", 1042, "そう思っています。", 1.4, 0, 0, "三角 千歌", 1, 0, 0, 1, 0, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "安芸真琴だ。", 1043, "う、疑ってすまなかったな…", 1.4, 0, 0, "安芸 真琴", 1, 0, 0, 1, 0, 1, "あぁ？\nお前のそいつの仲間か？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "わらわこそは夜を総べる者！", 1044, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1.4, 0, 0, "イリヤ・オーンスタイン", 1, 0, 0, 1, 0, 1, "生けとし生ける全ての者よ！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "そこで騎士は妖精を乱暴に……", 1045, "ｌク、クウカに何かご用ですか!?", 1.4, 0, 0, "遠見 空花", 1, 0, 0, 1, 0, 1, "ぐふふふふ……はっ！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1046, "う～ん…\n猫ってホントに最高にゃ～♪", 1.4, 0, 0, "宮坂たまき", 1, 0, 0, 1, 0, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "大神美冬よ！", 1048, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1.4, 0, 0, "大神 美冬", 1, 0, 0, 1, 0, 1, "それでは早速クエストに…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "星野静流だよ！", 1049, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1.4, 0, 0, "星野静流", 1, 0, 0, 1, 0, 1, "クエストもバトルも\n掃除も洗濯も");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "アタシは玉泉美咲。", 1050, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1.5, 0, 0, "玉泉美咲", 1, 0, 0, 1, 0, 1, "見ての通りの\nセクシー美少女で");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "？？？", 1052, "？？？？", 1.4, 0, 0, "リマ", 1, 0, 0, 1, 0, 1, "？？？？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "モニカ・ヴァイスヴィントだ。", 1053, "そ、そこまでいうなら\nもらってやる", 1.5, 0, 0, "モニカ・ヴァイスヴィント", 1, 0, 0, 1, 0, 1, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "モニカ・ヴァイスヴィントだ。", 1058, "そ、そこまでいうなら\nもらってやる", 1.5, 0, 0, "ペコリーヌ", 1, 0, 0, 1, 0, 1, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "モニカ・ヴァイスヴィントだ。", 1059, "そ、そこまでいうなら\nもらってやる", 1.5, 0, 0, "コッコロ", 1, 0, 0, 1, 0, 1, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, "モニカ・ヴァイスヴィントだ。", 1060, "そ、そこまでいうなら\nもらってやる", 1.5, 0, 0, "キャル", 1, 0, 0, 1, 0, 1, "菓子でつろうなどと\n稚拙な策を……");
